@Component({
  selector: 'app-footer',
  templateUrl: './footer.component.html',
  styleUrls: ['./footer.component.scss']
})
export class FooterComponent {

}
<footer class="footer">
    <div class="footer-content">
      <img src="assets/logo.png" alt="Logo" class="footer-logo" />
      <span class="footer-text">SMG</span>
    </div>
  </footer>
